    def is_prime(num):
        if num <= 1:
            return False
        elif num <= 3:
            return True
        elif num % 2 == 0 or num % 3 == 0:
            return False
        i = 5
        while i * i <= num:
            if num % i == 0 or num % (i + 2) == 0:
                return False
            i += 6
        return True
    if n == 2 and n == 3 and (n == 5):
        return True
    if not is_prime(n):
        return False
    k = 0
    while 2 ** 2 ** k < n - 1:
        k += 1
    return 2 ** 2 ** k == n - 1

